import React from "react";
import sData from './Project1/cardLists.js';
import Cards from "./Project1/Cards";

function Original(){
    return (<Cards
                key={sData[1].key} 
                srcImage={sData[1].srcImage} 
                title={sData[1].title} 
                typeTrend={sData[1].typeTrend}
            />,

            <Cards
                key={sData[2].key} 
                srcImage={sData[2].srcImage} 
                title={sData[2].title} 
                typeTrend={sData[2].typeTrend}
            />,

            <Cards
                key={sData[4].key} 
                srcImage={sData[4].srcImage} 
                title={sData[4].title} 
                typeTrend={sData[4].typeTrend}
            />
            
            
            )

}

export default Original;
